var output = "";
for (var i = 1; i <= 10; i++) {
    output += i;
    if (i % 5 == 0) {
        print(output);
        output = "";
        continue;
    }
    output += ", ";
}

function rng(n) {
    return n ? rng(n - 1).concat(n) : [];
}
console.log(
    rng(10).reduce(
        function(a, x) {
            return a + x.toString() + (x % 5 ? ', ' : '\n');
        }, ''
    )
);
